import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <header>
      <img src="blogimage.jpeg" alt="blog">
        <div className="container">
          <Link to="/">
            <h1>BLoG</h1>
          </Link>
        </div>
      </img>
    </header>
  );
};

export default NavBar;
